import React, { useEffect, useState } from 'react';
import { Bar } from 'react-chartjs-2';

const ChartJs = () => {
    const [chartData, setChartData] = useState({});

    const chart = () => {
        setChartData({
            labels: ['Peso inicial', 'Peso atual', 'Peso Alvo'],
            datasets: [
                {
                    label: 'levels',
                    data: [32, 45],
                    backgroundColor: 
                        'rgba(75, 192, 192, 0.6)',

                }
            ]
        });
    }
    useEffect(() => {
        chart()
    }, [])
    return(
        <div>
            <h1>GRAFICO GERAL</h1>
            <div>
               <Bar data={chartData} /> 
            </div>
        </div>
    )
}

export default ChartJs;
